INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24001, 24, "2030/12/17 14:59:59", 401, "アヤネ", 10046, 102301, 0.0, 0.0, 0.0, "2020/07/31 12:00:00", "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 2, 2);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24002, 24, "2030/12/17 14:59:59", 402, "アヤネ", 10046, 102301, 0.0, 2.21, 0.0, "2020/07/31 12:00:00", "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 1, 2);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24003, 24, "2030/12/17 14:59:59", 403, "アヤネ", 10046, 102301, 0.0, 0.0, 0.0, "2020/07/31 12:00:00", "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 2, 2);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24004, 24, "2030/12/17 14:59:59", 701, "アサヒ", 10046, 192201, 0.0, 1.99, 0.0, "2020/07/31 12:00:00", "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 2, 1);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24005, 24, "2030/12/17 14:59:59", 702, "アサヒ", 10046, 192201, 0.0, 2.21, 0.0, "2020/07/31 12:00:00", "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 1, 2);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24006, 24, "2030/12/17 14:59:59", 703, "アサヒ", 10046, 192201, 0.0, 3.33, 0.0, "2020/07/31 12:00:00", "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 2, 1);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24007, 24, "2030/12/17 14:59:59", 801, "部員３", 10046, 192301, 0.0, 0.0, 0.0, "2020/07/31 12:00:00", "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 2, 2);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24008, 24, "2030/12/17 14:59:59", 802, "部員３", 10046, 192301, 0.0, 2.68, 0.0, "2020/07/31 12:00:00", "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 1, 2);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24009, 24, "2030/12/17 14:59:59", 803, "部員３", 10046, 192301, 0.0, 0.0, 0.0, "2020/07/31 12:00:00", "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 2, 2);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24010, 24, "2030/12/17 14:59:59", 501, "", 10046, 192501, 0.0, 0.0, 0.0, "2020/07/31 12:00:00", "やった！", 1, 1);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24011, 24, "2030/12/17 14:59:59", 502, "", 10046, 192501, 0.0, 0.0, 0.0, "2020/07/31 12:00:00", "勝ったよ！", 1, 1);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24012, 24, "2030/12/17 14:59:59", 503, "", 10046, 192501, 0.0, 0.0, 0.0, "2020/07/31 12:00:00", "いい調子！", 1, 1);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24013, 24, "2030/12/17 14:59:59", 111, "ミサト", 10046, 113501, 0.0, 5.33, 0.0, "2020/07/31 12:00:00", "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 6, 2);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24014, 24, "2030/12/17 14:59:59", 112, "ミサト", 10046, 113501, 0.0, 6.85, 0.0, "2020/07/31 12:00:00", "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 1, 2);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24015, 24, "2030/12/17 14:59:59", 113, "ミサト", 10046, 113501, 0.0, 3.0, 0.0, "2020/07/31 12:00:00", "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 1, 2);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24016, 24, "2030/12/17 14:59:59", 611, "ダイチ", 10046, 192401, 0.0, 6.11, 0.0, "2020/07/31 12:00:00", "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 1, 2);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24017, 24, "2030/12/17 14:59:59", 612, "ダイチ", 10046, 192401, 0.0, 6.75, 0.0, "2020/07/31 12:00:00", "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 1, 2);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24018, 24, "2030/12/17 14:59:59", 613, "ダイチ", 10046, 192401, 0.0, 0.0, 0.0, "2020/07/31 12:00:00", "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 2, 2);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24019, 24, "2030/12/17 14:59:59", 211, "ハツネ", 10046, 113401, 0.0, 4.52, 0.0, "2020/07/31 12:00:00", "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 2, 1);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24020, 24, "2030/12/17 14:59:59", 212, "ハツネ", 10046, 113401, 0.0, 3.89, 0.0, "2020/07/31 12:00:00", "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 2, 1);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24021, 24, "2030/12/17 14:59:59", 213, "ハツネ", 10046, 113401, 0.0, 13.49, 0.0, "2020/07/31 12:00:00", "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 1, 2);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24022, 24, "2030/12/17 14:59:59", 311, "カヤ", 10046, 106501, 0.0, 3.17, 0.0, "2020/07/31 12:00:00", "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 1, 2);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24023, 24, "2030/12/17 14:59:59", 312, "カヤ", 10046, 106501, 0.0, 4.42, 0.0, "2020/07/31 12:00:00", "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 1, 2);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24024, 24, "2030/12/17 14:59:59", 313, "カヤ", 10046, 106501, 0.0, 2.89, 0.0, "2020/07/31 12:00:00", "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 6, 1);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24025, 24, "2030/12/17 14:59:59", 421, "アヤネ", 10046, 102301, 0.0, 3.71, 0.0, "2020/07/31 12:00:00", "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 4, 3);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24026, 24, "2030/12/17 14:59:59", 721, "アサヒ", 10046, 192201, 0.0, 5.1, 0.0, "2020/07/31 12:00:00", "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 2, 1);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24027, 24, "2030/12/17 14:59:59", 821, "部員３", 10046, 192301, 0.0, 4.34, 0.0, "2020/07/31 12:00:00", "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 1, 3);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24028, 24, "2030/12/17 14:59:59", 521, "", 10046, 192501, 0.0, 0.0, 0.0, "2020/07/31 12:00:00", "いい勝負だったよ\nまたやろうね", 1, 1);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24029, 24, "2030/12/17 14:59:59", 101, "ミサト", 10046, 113501, -360.0, 5.62, 0.0, "2020/07/31 12:00:00", "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 1, 2);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24030, 24, "2030/12/17 14:59:59", 102, "ミサト", 10046, 113501, -360.0, 9.58, 0.0, "2020/07/31 12:00:00", "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 1, 2);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24031, 24, "2030/12/17 14:59:59", 103, "ミサト", 10046, 113501, -360.0, 0.0, 0.0, "2020/07/31 12:00:00", "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 2, 2);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24032, 24, "2030/12/17 14:59:59", 104, "ミサト", 10046, 113501, -360.0, 9.13, 0.0, "2020/07/31 12:00:00", "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 2, 1);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (24033, 24, "2030/12/17 14:59:59", 105, "ミサト", 10046, 113501, -360.0, 8.27, 0.0, "2020/07/31 12:00:00", "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 1, 2);
